import './App.css';
import { Routes, Route } from 'react-router-dom'
import Home from './components/Home'
import Fecha from './components/Fecha'

function App() {
  return (
  <div>
    <Routes>
      <Route path="/" component={<Home/>} />
      <Route path="/fecha" component={<Fecha />} />
    </Routes>
  </div>
)}

export default App;
